import React from "react";
import { NavLink } from "react-router-dom";

const Home = () => {

    return(

        <div>
        <div class="container">
          <nav class="navbar navbar-expand-lg navbar-light bg-light">
                <a class="navbar-brand" href="#">Navbar</a>
        </nav>
        </div>


        <div>

            <NavLink to="./Home">
                <button type="button" class="btn btn-primary btn-lg">Home</button>
            </NavLink>

            <NavLink to="./Patient">
                <button type="button" class="btn btn-primary btn-lg">Patient</button>
            </NavLink>

            <NavLink to="./Clinician">
                <button type="button" class="btn btn-primary btn-lg">Clinician</button>
            </NavLink>                        

        </div>

        </div>
    );

};

export default Home;
